script: |
  super -f text -I q12032.spq | sort > q12032.out

inputs:
  - name: q12032.spq
    data: |
      SELECT - ( col2 ) * + col0 + - col0 - col2 AS col1 FROM tab2 (FORMAT parquet) WHERE NOT NULL NOT IN ( + col1, 70 + - col2, - + CAST ( ( + 33 ) AS INTEGER ) );
  - name: tab2

outputs:
  - name: q12032.out
    data: |
